import React, { useState, useEffect } from 'react';

import Card from '../Components/card';

export default function ToDoPage () {
    const [todo, setTodo] = useState([])

    useEffect(() => {
        fetch('/api').then(response => {
            if(response.ok){
                return response.json()
            }
        }).then(data => setTodo(data))
    }, [])

    return (
        <div>
            <Card />
        </div>
    );
}

